(188, 1, 4, '', 'fullwidth_top', '&lt;h4&gt;&lt;br&gt;&lt;/h4&gt;&lt;h4&gt;Alpha Pioneer is owned by our parent company Sin Hiap Hoe Transport Pte. Ltd., which was started in 1960 and later incorporated in 1974.&lt;/h4&gt;&lt;h4 style=&quot;text-align: justify;&quot;&gt;Building a distribution network throughout Asia-Pacific&lt;/h4&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;From the beginning, we earned the trust of major industry players with our sound logistics and trustworthy approach to business. For over 50 years, the core of our business focused on the bulk haulage of fuel for Shell, as well as distributing products for other renowned organisations, such as Procter &amp;amp; Gamble, Nestle and TyrePac.&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;With this diversity of brands under our care, we developed a strong expertise in distributing both fast-moving consumer goods (FMCG) and professional business-to-business (828) products that are vital to the survival of various industries.&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;Over the years, our clients have continued to trust us for delivering exceptional product value and customer service and for accelerating their growth and distribution throughout Asia-Pacific.&lt;/p&gt;&lt;h4 style=&quot;text-align: justify;&quot;&gt;Going further: Generating consumer demand&lt;/h4&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;Today, our expertise goes beyond distributing products to retailers in FMCG and professional markets. We drive sales for partner brands with our marketing strategies a Increasing our clients\' penetration and profitability in markets across the region.&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'catalog/AlphaPoineer/about/img1.jpg', 0),
(189, 1, 4, '', 'image_left', '&lt;h4 id=&quot;our-mission-value&quot;&gt;&lt;strong&gt;Our Mission&lt;/strong&gt;&lt;/h4&gt;&lt;p&gt;We aspire to be a preferred partner to meaningful brands in Asia Pacific. We do so by lever aging our wide distribution network, sales and marketing know how, and our ability to deliver excellent cost efficiency&lt;br&gt;&lt;/p&gt;&lt;h4&gt;&lt;strong&gt;Our Corporate Culture and Values&lt;/strong&gt;&lt;br&gt;&lt;/h4&gt;&lt;p&gt;Our values guide our priorities when delivering outstanding service to clients.&lt;/p&gt;&lt;p&gt;At our core, we believe that our people are the key to excellence. By hiring people with the right expertise and seeing through programmes that develop their capabilities, we empower them to deliver results and service excellence to our customers.&lt;/p&gt;&lt;table style=&quot;width:100%; vertical-align:top;&quot; class=&quot; cke_show_border&quot;&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td style=&quot;text-align: justify; vertical-align:top; width:35px;&quot;&gt;&lt;img alt=&quot;check&quot; class=&quot;img-responsive &quot; data-cke-saved-src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; style=&quot;width: 30px; height: 30px;&quot;&gt;&lt;/td&gt;&lt;td&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;Integrity and strong business ethics are at the core of our company. We maintain the highest standards of fairness, honesty and respect with everyone we engage - so as to build long-term relationships and trusted partnerships.&lt;br&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td style=&quot;text-align: justify; vertical-align:top;&quot;&gt;&lt;img alt=&quot;check&quot; class=&quot;img-responsive &quot; data-cke-saved-src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; style=&quot;height: 30px; width: 30px;&quot;&gt;&amp;nbsp;&lt;/td&gt;&lt;td&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;Excellence is what we strive towards and this is reflected in the way we work with partners, brands and our employees.&lt;br&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td style=&quot;text-align: justify; vertical-align:top;&quot;&gt;&lt;img alt=&quot;check&quot; class=&quot;img-responsive &quot; data-cke-saved-src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; src=&quot;image/catalog/AlphaPoineer/about/check.png&quot; style=&quot;width: 30px; height: 30px;&quot;&gt;&amp;nbsp;&lt;/td&gt;&lt;td style=&quot;text-align: justify;&quot;&gt;Leadership qualities are integral to our business. We take ownership of our decisions and hold ourselves accountable for the results we achieve.&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', 'catalog/AlphaPoineer/about/img2.jpg', 0),
(190, 1, 4, '', 'fullwidth_top', '&lt;h4 style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/h4&gt;&lt;h4 style=&quot;text-align: center;&quot; id=&quot;winning_partnership&quot;&gt;&lt;br&gt;&lt;/h4&gt;&lt;div style=&quot;padding: 0 100px 0 100px&quot;&gt;&lt;br&gt;&lt;/div&gt;', '', 0);
