(36, 'Homepage About', 'html', '{\"name\":\"Homepage About\",\"module_description\":{\"1\":{\"title\":\"\",\"description\":\"&lt;div class=&quot;repeater-row-content&quot;&gt;\\r\\n&lt;div class=&quot;information-row fullwidth flex ttb&quot;&gt;\\r\\n&lt;div class=&quot;image information-col&quot;&gt;&lt;img class=&quot;img-responsive&quot; src=&quot;image\\/catalog\\/AlphaPoineer\\/home\\/bg1.jpg&quot; \\/&gt;&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;text information-col&quot;&gt;\\r\\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; class=&quot;tbl_homepage_about&quot; style=&quot;float: right; margin-top: -460px; background-color:white;&quot;&gt;\\r\\n\\t&lt;tbody&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td style=&quot;padding: 64px 64px 57px 83px; text-align: justify;&quot;&gt;\\r\\n\\t\\t\\t&lt;h3&gt;About Alpha Poineer&lt;\\/h3&gt;\\r\\n\\r\\n\\t\\t\\t&lt;p style=&quot;text-align: justify;&quot;&gt;Alpha poineer is owned by our parent Sin Hiap Home Ptle.Ltd., which was started in 1960 and later incorporated in 1974.&lt;\\/p&gt;\\r\\n\\r\\n\\t\\t\\t&lt;p style=&quot;text-align: justify;&quot;&gt;From the beginning, we earned the trust of major industry players with our sound logistics and trustworthy approach to business. For over 50 years, the core of our business focused on the bulk haulage of fuel for Shell, as well as distributing products for other renowned organisations, such as Procter &amp; Gamble, Nestle and TyrePac.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n\\t\\t\\t&lt;div class=&quot;article-button&quot;&gt;&lt;a class=&quot;btn btn-primary btn-sm&quot; href=&quot;.\\/about-us&quot;&gt;KNOW MORE&lt;\\/a&gt;&lt;\\/div&gt;\\r\\n\\t\\t\\t&lt;\\/td&gt;\\r\\n\\t\\t&lt;\\/tr&gt;\\r\\n\\t&lt;\\/tbody&gt;\\r\\n&lt;\\/table&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\"}},\"status\":\"1\"}'),
(37, 'Featured Collections 2', 'featured', '{\"name\":\"Featured Collections 2\",\"title\":{\"1\":\"Featured Collections\"},\"description\":{\"1\":\"\"},\"product_name\":\"\",\"product\":[\"1\",\"4\",\"2\"],\"status\":\"1\"}'),
(38, 'Why Choose Alpha Pioneer', 'html', '{\"name\":\"Why Choose Alpha Pioneer\",\"module_description\":{\"1\":{\"title\":\"Why Choose Alpha Pioneer\",\"description\":\"&lt;div class=&quot;container&quot;&gt;\\r\\n&lt;div class=&quot;row&quot;&gt;\\r\\n&lt;div class=&quot;col-md-4 col-xs-4&quot;&gt;\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;icon1&quot; class=&quot;img-responsive &quot; src=&quot;image\\/catalog\\/AlphaPoineer\\/home\\/icon1.png&quot; style=&quot;width: 157px; height: 187px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;h4 style=&quot;text-align: center;&quot;&gt;International Delivery&lt;\\/h4&gt;\\r\\n\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;We help to manage a fuss delivery to your &lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;disired destination around the world!&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;col-md-4 col-xs-4&quot;&gt;\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;icon2&quot; class=&quot;img-responsive &quot; src=&quot;image\\/catalog\\/AlphaPoineer\\/home\\/icon2.png&quot; style=&quot;width: 188px; height: 188px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;h4 style=&quot;text-align: center;&quot;&gt;10% Off Promotion&lt;\\/h4&gt;\\r\\n\\r\\n&lt;h6 style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;Shop now to enjoy 10% off on your first order&lt;\\/span&gt;&lt;\\/h6&gt;\\r\\n\\r\\n&lt;h6 style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt; while stock last&lt;\\/span&gt;&lt;\\/h6&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;col-md-4 col-xs-4&quot;&gt;\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;icon3&quot; class=&quot;img-responsive &quot; src=&quot;image\\/catalog\\/AlphaPoineer\\/home\\/icon3.png&quot; style=&quot;width: 170px; height: 187px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;h4 style=&quot;text-align: center;&quot;&gt;Consultations on Technical Specs&lt;\\/h4&gt;\\r\\n\\r\\n&lt;h6 style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;Got questions? Need help quick? We are here&lt;\\/span&gt;&lt;\\/h6&gt;\\r\\n\\r\\n&lt;h6 style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;\\u00a0to help! Contact us.&lt;\\/span&gt;&lt;\\/h6&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;row&quot;&gt;\\r\\n&lt;div class=&quot;col-md-12&quot;&gt;\\r\\n&lt;div class=&quot;centered&quot;&gt;&lt;a class=&quot;btn btn-primary btn-sm&quot; href=&quot;.\\/products&quot; style=&quot;padding: 6px 20px&quot;&gt;Shop Now&lt;\\/a&gt;&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\"}},\"status\":\"1\"}'),
(39, 'About Alpha Pioneer', 'html', '{\"name\":\"About Alpha Pioneer\",\"module_description\":{\"1\":{\"title\":\"About Alpha Pioneer\",\"description\":\"&lt;div class=&quot;row centered&quot;&gt;\\r\\n&lt;div class=&quot;col-md-8 about-us-nav&quot;&gt;&lt;a href=&quot;about-us#our-story&quot;&gt;Our Story&lt;\\/a&gt; &lt;a href=&quot;about-us#our-mission-value&quot;&gt;Our Mission &amp; Value&lt;\\/a&gt; &lt;a href=&quot;about-us#why-partner-us&quot;&gt;Why Partner Us&lt;\\/a&gt; &lt;a href=&quot;about-us#our-network&quot;&gt;Our Network&lt;\\/a&gt;&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\"}},\"status\":\"1\"}'),
(40, 'Our Network', 'html', '{\"name\":\"Our Network\",\"module_description\":{\"1\":{\"title\":\"Our Network\",\"description\":\"&lt;p id=&quot;our-network&quot; style=&quot;text-align: center;&quot;&gt;Alpha pioneer has a strong presence across Asia-Pacific. Our network extends throughout 14 countries, including Singapore, Malaysia, Indonesia,&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;Thailand, Cambodia, Vietnam, laos, Myammar, Philippines, Brunei, Hong Kong, China, South Korea and Japan.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;map&quot; class=&quot;img-responsive   &quot; src=&quot;image\\/catalog\\/AlphaPoineer\\/about\\/map.jpg&quot; style=&quot;width: 80%; height: 600px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\"}},\"status\":\"1\"}'),
