(39598, 0, 'winning_partnership', 'winning_partnership_title_1', 'A WINNING PARTNERSHIP', 0),
(39599, 0, 'winning_partnership', 'winning_partnership_main_description_1', '&lt;p style=&quot;text-align: center;&quot;&gt;At Alpha Pioneer, we\'re confident that we have the experience, expertise and network to get your brand into the hands of customers throughout&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: center;&quot;&gt;Asia-Pacific. These are just some of the reasons why our clients have continued to trust us for over 50 years.&lt;/p&gt;', 0),
(39600, 0, 'winning_partnership', 'winning_partnership_items_1', '[{\"id\":\"1\",\"title\":\"We have the best understanding of the Singapore market environment, hands down\",\"text\":\"Our team has built a wide network of retailers and corporations. Also, we have several decades of detailed retailer and consumer insights that you can leverage on to spread your reach even further.\",\"upload\":\"catalog\\/AlphaPoineer\\/about\\/icon1.png\"},{\"id\":\"2\",\"title\":\"100% in-house, 0% outsourced\",\"text\":\"Brands trust us as their one-stop distribution and marketing partner, thanks to our proven logistics expertise, large network and dedicated delivery fleet. As our partner, your brand is in our hands every step of the way-we\",\"upload\":\"catalog\\/AlphaPoineer\\/about\\/icon2.png\"},{\"id\":\"3\",\"title\":\"An agile, flexible team\",\"text\":\"Our team structure promotes synergy, agility and flexibility. This allows our creative ideas to flow and decisions to be made quickly, enabling us to respond quickly to market demands and fluctuations- so your brands can always be in the right place, at the right time.\",\"upload\":\"catalog\\/AlphaPoineer\\/about\\/icon3.png\"},{\"id\":\"4\",\"title\":\"We understand budgets\",\"text\":\"Cost management is at the heart of every business, as this factor has a significant impact on profitability. We get it, and are open to customising our service offerings - so your resources can be utilised in the most efficient\",\"upload\":\"catalog\\/AlphaPoineer\\/about\\/icon4.png\"},{\"id\":\"5\",\"title\":\"We want to be your lifelong partner\",\"text\":\"Our business decisions are always made with the benefit of your brand in mind. We want to help build your brand into a leading force in Asia-Pacific, so together, we can benefit from a\",\"upload\":\"catalog\\/AlphaPoineer\\/about\\/icon5.png\"}]', 1),
(39601, 0, 'winning_partnership', 'winning_partnership_status', '1', 0),
